import React, { Component } from "react";

class Popup extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="popup">
        <div className="popup_inner text-center">
          <p className="p-5">asd</p>
          <button
            className="btn btn-danger m-2"
            onClick={this.props.closePopup}
          >
            Inchide
          </button>
        </div>
      </div>
    );
  }
}

export default Popup;
